import React from 'react';
import './operator.css';

export default function () {
    return(
//         <div className="container">
//         <h2>Patient Waiting List</h2>

//     <table className="table table-striped table-bordered table-hover">
//         <thead>
//             <tr>
//                 <th>ID</th>
//                 <th>Name</th>
//                 <th>Doctor</th>
//                 <th style={{width:85+'px'}}>Status</th>
//                 <th style={{width:65+'px'}}>Wait</th>
//                 <th style={{width:80+'px'}}>Message</th>
//                 <th style={{width:80+'px'}}>Connect</th>
//                 <th style={{width:80+'px'}}>Remove</th>
//             </tr>
//             </thead>
//             <tbody>
//                 {this.state.data && this.state.data.length>0 && this.state.data.map((value,index)=>{
//                     return <tr key={value.id+index}>
//                         <td>{value.id}</td>
//                         <td>{value.firstName} {value.lastName}</td>
//                         <td>{value.doctor.name}</td>
//                         <td>{value.status}</td>
//                         <td className='text-center'>{value.wait}</td>
//                         <td className='text-center'><span title="Send message to patient" onClick={this.message}>Message<i className="glyphicon glyphicon-log-in"></i></span></td>
//                         <td className="text-center"><span title="Connect with doctor" onClick={()=>{this.connect(value)}}>Connect<i className="glyphicon glyphicon-edit"></i></span></td>
//                         <td className="text-center"><span title="Remove patient from list" onClick={()=>{this.disconnect(value)}}><i className="glyphicon glyphicon-remove">Remove</i></span></td>
//                     </tr>
//                 })}
//             </tbody>
//     </table>
//   </div>
        <div className="page-content-wrapper ">
            <div className="content">
                <div className=" container-fluid   container-fixed-lg">
                    <div className="row">
                        <div className="col-lg-12">
                            <div className="card card-transparent">
                                <div className="card-header ">
                                    <div className="card-title">Doctors Dashboard
                                    </div>
                                </div>
                                <div className="card-body">
                                    <div className="row">
                                        <div class="col-lg-8">
                                            <div class="card card-default">
                                                <div class="card-header">
                                                    <div class="card-title"><h3><span class="semi-bold">Patient</span> List</h3>
                                                    </div>
                                                </div>
                                                <div class="card-body">
                                                    <div class="scrollable">
                                                        <div class="demo-card-scrollable">
                                                            <p>When it comes to digital design, the lines between functionality, aesthetics, and psychology are inseparably blurred. Without the constraints of the physical world, there’s no natural form to fall back on, and every bit of constraint and affordance must be introduced intentionally. Good design makes a product useful. A product is bought to be used. It has to satisfy certain criteria, not only functional, but also psychological and aesthetic. Good design emphasizes the usefulness of a product whilst disregarding anything that could possibly detract from it. It’s always obvious when design is an afterthought. The hallmarks of the engineering-first approach are everywhere: inscrutable interfaces, convoluted workflows, user guides the size of The Iliad. This was the dominant approach for the first several decades of personal computing, and it’s left its mark in the form of software designed with its creators in mind, rather than its users.</p>
                                                        </div>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
